# Linguistic Complexity of a Genome
# Use Trie to calculate the number of all substrings could be faster than enumerate one by one
# sum up all the Trie edges' length equal to the number of unique substrings. it's easy to be understood when trie is unzipped


import collections
from functools import cache

@cache
def build_suffix_graph( seq:str , idxes:tuple):
    graph = {}
    tmp_start = sorted(set([seq[start] for start in idxes]))
    for tmp_s in tmp_start:
        matching = [i for i in idxes if seq[i] == tmp_s ]
        extend = 1
        while True:    # get the max extension length
            if matching[-1]+extend < len(seq):
                tmp_set = set( [seq[i+extend] for i in matching ])
                if len(tmp_set) >1:
                    break
                extend += 1
            else:
                break
            
        nexts = [start + extend for start in matching if start + extend < len(seq)]
        graph[seq[matching[0]:matching[0]+extend]] = build_suffix_graph(seq, tuple(nexts))
    return graph

