def get_edges(graph):
    for k in graph.keys():
        yield k
        yield from get_edges(graph[k])

def calculate_max_num_substrings( n_length:int , a_size:int = 4 ) -> int:
    max_cnt = 0
    for i in range(1,n_length+1):
        tmp_max_sub = a_size**i 
        if tmp_max_sub > n_length: 
            break
        else:
            max_cnt += tmp_max_sub
    max_cnt += (n_length-i+1+1)*( n_length-i+1 )//2
    return max_cnt

def get_num_all_subs( seqs:str ) -> int:
    res = 0
    for i in range( 1, len(seqs)+1 ):
        tmp_seq = set()
        for j in range( len(seqs)-i+1 ):
            tmp_seq.add( seqs[j:j+i] )
        res += len(tmp_seq)
    return res

